import React from 'react'
import Card from '@material-ui/core/Card'
import { Link } from 'react-router-dom'

function MenuLink (props){
	return (
		<Card className="menulink" style={{
			width:200,
			height:120,
			background:"#f1f1f1",
			textAlign: "center",
			display: "flex",
			textDecoration:"none"

		}}>
			<h1>Hi</h1>
			<p component={Link} to={props.href} onClick={props.onPress}>Hier geht's zu den Aquarellen</p>
		</Card>
	)
}
export default MenuLink
